import Post from "../../component/Post";
//import Posts from "./Posts.css";

const Posts = (props) => {

    const posts = props.data.map(po => {
        return <Post
            id={po.id}
            tittle={po.tittle}
            author={po.author}
            key={po.id}

        />
    });
    return posts;

}

export default Posts;
